import React, {useState, useEffect} from 'react';
import { Link, useNavigate, useLocation } from "react-router-dom";
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBCheckbox,
  MDBIcon
}
from 'mdb-react-ui-kit';
import './ｌｏｇｉｎ.css';

function App() {
  const [allCheck, setAllCheck] = useState(false);
  const [ageCheck, setAgeCheck] = useState(false);
  const [useCheck, setUseCheck] = useState(false);
  const [marketingCheck, setMarketingCheck] = useState(false);
  const navigate = useNavigate();

  const allBtnEvent =()=>{
    if(allCheck === false) {
      setAllCheck(true);
      setAgeCheck(true);
      setUseCheck(true);
      setMarketingCheck(true);
    }else {
      setAllCheck(false);
      setAgeCheck(false);
      setUseCheck(false);
      setMarketingCheck(false);
    } 
  };
  
  const ageBtnEvent =()=>{
    if(ageCheck === false) {
      setAgeCheck(true)
    }else {
      setAgeCheck(false)
    }
  };
  
  const useBtnEvent =()=>{
    if(useCheck === false) {
      setUseCheck(true)
    }else {
      setUseCheck(false)
    }
  };
  
  const marketingBtnEvent =()=>{
    if(marketingCheck === false) {
      setMarketingCheck(true)
    }else {
      setMarketingCheck(false)
    }
  };

  useEffect(()=>{
    if(ageCheck===true && useCheck===true && marketingCheck===true){
      setAllCheck(true)
    } else {
      setAllCheck(false)
    }
  }, [ageCheck,useCheck, marketingCheck])
  


  return (
    <MDBContainer fluid className='p-4 background-radial-gradient overflow-hidden'>

      <MDBRow>

        <MDBCol md='6' className='text-center text-md-start d-flex flex-column justify-content-center'>

          <h1 className="my-5 display-3 fw-bold ls-tight px-3" style={{color: 'hsl(218, 81%, 95%)'}}>
            Kaimind <br />
            <span style={{color: 'hsl(218, 81%, 75%)'}}>친구들과 시작해보세요!</span>
          </h1>

          <p className='px-3' style={{color: 'hsl(218, 81%, 85%)'}}>
            
          </p>

        </MDBCol>

        <MDBCol md='6' className='position-relative'>

          <div id="radius-shape-1" className="position-absolute rounded-circle shadow-5-strong"></div>
          <div id="radius-shape-2" className="position-absolute shadow-5-strong"></div>

          <MDBCard className='my-5 bg-glass'>
            <MDBCardBody className='p-5'>
              <MDBInput wrapperClass='mb-4' label='별명' id='form1' type='text'/>
              <MDBRow>
                <MDBCol md='9'>
                  <MDBInput wrapperClass='mb-4' label='이메일' id='form2' type='email'/>
                </MDBCol>
                <MDBCol md='3'>
                  <MDBBtn className='w-100 mb-4' size='md'>중복 체크</MDBBtn>
                </MDBCol>
              </MDBRow>
              <MDBInput wrapperClass='mb-4' label='비밀번호' id='form3' type='password'/>
              <MDBInput wrapperClass='mb-4' label='비밀번호 확인' id='form4' type='password'/>

              <div className='d-flex justify-content-start mb-3'>
                <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label={<span>만 14세 이상입니다 <span style={{ color: 'royalblue' }}>(필수)</span></span>} />
                <div></div>
              </div>
              <div className='d-flex justify-content-start mb-3'>
                <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label={<span>이용약관 동의 <span style={{ color: 'royalblue' }}>(필수)</span></span>} />
              </div>
              <div className='d-flex justify-content-start mb-3'>
                <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label={<span>마케팅 동의 <span style={{ color: 'darkgray' }}>(선택)</span></span>} />
              </div>

              <MDBBtn className='w-100 mb-4' size='md'>회원가입</MDBBtn>

              <div className="text-center">

                <p>다음 계정으로 가입하기</p>

                <MDBBtn tag='a' color='none' className='mx-3 mb-3' style={{ color: '#1266f1' }}>
                  <img src="/img/kakao.png" alt="Kakao" width="30" height="30" />
                </MDBBtn>
              </div>

              <div className="text-center">
                <p>이미 계정이 있으신가요?</p>
                <Link to="login">로그인</Link>
              </div>

            </MDBCardBody>
          </MDBCard>

        </MDBCol>

      </MDBRow>

    </MDBContainer>
  );
}

export default App;
